import { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const AddCatPage = () => {
  const navigate = useNavigate();

  const [name, setName] = useState('');
  const [origin, setOrigin] = useState('');
  const [temperament, setTemperament] = useState('');
  const [colors, setColors] = useState('');
  const [description, setDescription] = useState('');
  const [image, setImage] = useState('');

  const submitHandler = async (e) => {
    e.preventDefault();
    try {
      const formData = new FormData();
      formData.append('name', name);
      formData.append('origin', origin);
      formData.append('temperament', temperament);
      formData.append('colors', colors.split(',').map(color => color.trim())); // Assuming colors are entered as comma-separated values
      formData.append('description', description);
      formData.append('image', image);

      const uploadResponse = await axios.post('http://localhost:5555/api/uploads', formData, { withCredentials: true });

      setImage(uploadResponse.data.image);
      alert('Image uploaded successfully');

      // Then, submit the rest of the form data
      const response = await axios.post('http://localhost:5555/api/cats', {
        ...formData,
        image: uploadResponse.data.image
      }, { withCredentials: true });

      navigate('/cats/dashboard');
    } catch (error) {
      alert(error?.response?.data?.message || error.message);
    }
  }

  const handleImageChange = (e) => {
    const file = e.target.files[0];
    setImage(file);
  }

  return (
    <div className="container mt-5">
      <h1>Add New Cat</h1>
      <form onSubmit={submitHandler}>
        <table className="table table-bordered">
          <tbody>
            <tr>
              <th>Name:</th>
              <td><input type="text" className="form-control" value={name} onChange={(e) => setName(e.target.value)} required /></td>
            </tr>
            <tr>
              <th>Origin:</th>
              <td><input type="text" className="form-control" value={origin} onChange={(e) => setOrigin(e.target.value)} required /></td>
            </tr>
            <tr>
              <th>Temperament:</th>
              <td><input type="text" className="form-control" value={temperament} onChange={(e) => setTemperament(e.target.value)} required /></td>
            </tr>
            <tr>
              <th>Colors:</th>
              <td><input type="text" className="form-control" value={colors} onChange={(e) => setColors(e.target.value)} required /></td>
            </tr>
            <tr>
              <th>Description:</th>
              <td><textarea className="form-control" value={description} onChange={(e) => setDescription(e.target.value)} required /></td>
            </tr>
            <tr>
              <th>Image:</th>
              <td><input type="file" className="form-control" onChange={handleImageChange} required /></td>
            </tr>
          </tbody>
        </table>
        <button type="submit" className="btn btn-primary">Add Cat</button>
      </form>
    </div>
  );
}

export default AddCatPage;
